import React, { Component } from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  InputGroup,
  InputGroupAddon,
  InputGroupText,
  Input,
  CardDeck
} from "react-bootstrap";
import { Form, Button, Col, Card, Table } from "react-bootstrap";
import "./RetriveRecords.css";

class RetriveRecords extends Component {
  render() {
    return (
      <div className="form">
        <Card style={{ width: "48rem" }}>
          <Card.Header>Search Patient Records</Card.Header>
          <Card.Body>
            <form
              noValidate
              //validated={validated}
              //onSubmit={e => this.handleSubmit(e)}
            >
              <Form.Row>
                <Form.Group as={Col}>
                  <Form.Label>From Date</Form.Label>
                  <Form.Control
                    required
                    type="date"
                    placeholder=""
                    //value={this.state.admissionDate}
                    name="admissionDate"
                    //onChange={this.handleChange}
                  />
                </Form.Group>
                <Form.Group as={Col}>
                  <Form.Label>To Date</Form.Label>
                  <Form.Control
                    required
                    type="date"
                    placeholder="Discharge Date"
                    //value={this.state.dischageDate}
                    name="dischageDate"
                    //onChange={this.handleChange}
                  />
                </Form.Group>
                <Button variant="primary" type="submit">
                  Submit
                </Button>
              </Form.Row>
            </form>
            {/* <div>
              <input
                style={{ width: "45rem" }}
                placeholder="Search for..."
                // value={this.state.query}
                // onChange={this.handleInputChange}
              />
            </div> */}
          </Card.Body>
        </Card>

        <Card className="cardstyle">
          <Card.Header
            style={{
              backgroundColor: "#96966b",
              color: "#00BFFF",
              fontWeight: 500,
              fontSize: "1.3rem"
            }}
          >
            Search Results
          </Card.Header>
          <Card.Body>
            <Table striped bordered hover>
              <thead>
                <tr>
                  <th>S.NO</th>
                  <th>IP.NO</th>
                  <th>Patient Name</th>
                  <th>Final Diagnosis</th>
                  <th>Age</th>
                  <th>Sex</th>
                  <th>DOA</th>
                  <th>DOD</th>
                  <th>Edit</th>
                </tr>
              </thead>
              <tbody>
                <tr>
                  <td>1</td>
                  <td>Mark</td>
                  <td>Otto</td>
                  <td>@mdo</td>
                  <td>1</td>
                  <td>Mark</td>
                  <td>Otto</td>
                  <td>@mdo</td>
                  <td>
                    <span className="d-inline-block">
                      <FontAwesomeIcon
                        icon={["fas", "edit"]}
                        //onClick={this.handleShow}
                        style={{ color: "#00BFFF" }}
                      />
                    </span>
                  </td>
                </tr>
                <tr>
                  <td>2</td>
                  <td>Jacob</td>
                  <td>Thornton</td>
                  <td>@fat</td>
                  <td>1</td>
                  <td>Mark</td>
                  <td>Otto</td>
                  <td>@mdo</td>
                  <td>
                    <span className="d-inline-block">
                      <FontAwesomeIcon
                        icon={["fas", "edit"]}
                        //onClick={this.handleShow}
                        style={{ color: "#00BFFF" }}
                      />
                    </span>
                  </td>
                </tr>
                {/* <tr>
                  <td>3</td>
                  <td>Larry the Bird</td>
                  <td>@twitter</td>
                  <td>1</td>
                  <td>Mark</td>
                  <td>Otto</td>
                  <td>@mdo</td>
                  <td>1</td>
                  <td>
                    <span className="d-inline-block">
                      <FontAwesomeIcon
                        icon={["fas", "edit"]}
                        style={{ color: "#00BFFF" }}
                        //onClick={this.handleShow}
                      />
                    </span>
                  </td>
                </tr> */}
              </tbody>
            </Table>
          </Card.Body>
        </Card>
      </div>
    );
  }
}
export default RetriveRecords;
